(1, ' A + B', '<p>You are given two integer A and B. Find summation of A and B .</p>\n', 'You will be given an integer&nbsp;<strong>T</strong>&nbsp;(<span class=\"equation\">\\(1\\leq T \\leq 10^3\\)</span>) in the first line. In next T lines there will be two integer <strong>A,B</strong>&nbsp;(<span class=\"equation\">\\(1\\leq A,B \\leq 10^{12}\\)</span>).', 'For each test case, print the summation of <strong>A</strong> and <strong>B</strong>.', '<span class=\"equation\">\\(1\\leq T \\leq 10^3\\)</span><br />\n<span class=\"equation\">\\(1\\leq A,B \\leq 10^{12}\\)</span>', '3<br />\n1 2<br />\n2 3<br />\n4 5', 'Case 1: 3<br />\nCase 2: 5<br />\nCase 3: 9', '', 2, 12800, NULL, 1, '2020-01-24 00:00:00'),
(3, 'Bangladesh Strong In Math', '<p>In the wilds far beyond lies the Land of Sacredness, which can be viewed as a tree &nbsp;&mdash; connected undirected graph consisting of&nbsp;nn&nbsp;nodes and&nbsp;n&minus;1n&minus;1&nbsp;edges. The nodes are numbered from&nbsp;11&nbsp;to&nbsp;nn.</p>\n\n<p>There are&nbsp;mm&nbsp;travelers attracted by its prosperity and beauty. Thereupon, they set off their journey on this land. The&nbsp;ii-th traveler will travel along the shortest path from&nbsp;sisi&nbsp;to&nbsp;titi. In doing so, they will&nbsp;go through&nbsp;all edges in the shortest path from&nbsp;sisi&nbsp;to&nbsp;titi, which is unique in the tree.</p>\n\n<p>During their journey, the travelers will acquaint themselves with the others. Some may even become friends. To be specific, the&nbsp;ii-th traveler and the&nbsp;jj-th traveler will become friends if and only if there are&nbsp;at least&nbsp;kk&nbsp;edges that both the&nbsp;ii-th traveler and the&nbsp;jj-th traveler will&nbsp;go through.</p>\n\n<p>Your task is to find out the number of pairs of travelers&nbsp;(i,j)(i,j)&nbsp;satisfying the following conditions:</p>\n\n<ul>\n <li>1&le;i&lt;j&le;m1&le;i&lt;j&le;m.</li>\n  <li>the&nbsp;ii-th traveler and the&nbsp;jj-th traveler will become friends.</li>\n</ul>\n', 'The first line contains three integers&nbsp;nn,&nbsp;mm&nbsp;and&nbsp;kk&nbsp;(2&le;n,m&le;1.5&sdot;1052&le;n,m&le;1.5&sdot;105,&nbsp;1&le;k&le;n1&le;k&le;n).<br />\nEach of the next&nbsp;n&minus;1n&minus;1&nbsp;lines contains two integers&nbsp;uu&nbsp;and&nbsp;vv&nbsp;(1&le;u,v&le;n1&le;u,v&le;n), denoting there is an edge between&nbsp;uu&nbsp;and&nbsp;vv.<br />\nThe&nbsp;ii-th line of the next&nbsp;mm&nbsp;lines contains two integers&nbsp;sisi&nbsp;and&nbsp;titi&nbsp;(1&le;si,ti&le;n1&le;si,ti&le;n,&nbsp;si&ne;tisi&ne;ti), denoting the starting point and the destination of&nbsp;ii-th traveler.<br />\nIt is guaranteed that the given edges form a tree.', '<br />\nThe only line contains a single integer &nbsp;&mdash; the number of pairs of travelers satisfying the given conditions.', '', '8 4 1<br />\n1 7<br />\n1 2<br />\n2 5<br />\n4 6<br />\n6 3<br />\n6 2<br />\n6 8<br />\n7 8<br />\n3 8<br />\n2 6<br />\n4 1<br />\n&nbsp;', '4', '<p><img alt=\"\" height=\"74\" src=\"https://espresso.codeforces.com/238216da68c34b418571920cacddd6194f408878.png\" width=\"800\" /></p>\n\n<p>In the first example there are&nbsp;44&nbsp;pairs satisfying the given requirements:&nbsp;(1,2)(1,2),&nbsp;(1,3)(1,3),&nbsp;(1,4)(1,4),&nbsp;(3,4)(3,4).</p>\n\n<ul>\n <li>The&nbsp;11-st traveler and the&nbsp;22-nd traveler both go through the edge&nbsp;6&minus;86&minus;8.</li>\n  <li>The&nbsp;11-st traveler and the&nbsp;33-rd traveler both go through the edge&nbsp;2&minus;62&minus;6.</li>\n  <li>The&nbsp;11-st traveler and the&nbsp;44-th traveler both go through the edge&nbsp;1&minus;21&minus;2&nbsp;and&nbsp;2&minus;62&minus;6.</li>\n <li>The&nbsp;33-rd traveler and the&nbsp;44-th traveler both go through the edge&nbsp;2&minus;62&minus;6.</li>\n</ul>\n', 1, 128000, NULL, 7, '2020-02-27 16:44:11'),
(10, 'Bangladesh Play', '<p>Write a program which reads a rectangle and a circle, and determines whether the circle is arranged inside the rectangle. As shown in the following figures, the upper right coordinate&nbsp;(W,H)(W,H)&nbsp;of the rectangle and the central coordinate&nbsp;(x,y)(x,y)&nbsp;and radius&nbsp;rr&nbsp;of the circle are given.</p>\n\n<div style=\"text-align:center\">\n<figure class=\"image\" style=\"display:inline-block\"><img alt=\"Circle inside a rectangle\" src=\"http://judge.u-aizu.ac.jp/onlinejudge/IMAGE2/circle_and_rectangle.png\" />\n<figcaption>Follow this system</figcaption>\n</figure>\n</div>\n\n<p>&nbsp;</p>\n', 'Five integers&nbsp;WW,&nbsp;HH,&nbsp;xx,&nbsp;yy&nbsp;and&nbsp;rr&nbsp;separated by a single space are given in a line.', 'Print &quot;Yes&quot; if the circle is placed inside the rectangle, otherwise &quot;No&quot; in a line.', '<span class=\"equation\">\\(-100 \\leq x,y \\leq 100\\)</span><br />\n<span class=\"equation\">\\(0 &lt; W,H,r \\leq 100\\)</span>', '5<br />\n4<br />\n2<br />\n2<br />\n1', 'Yes', '', 3, 12800, NULL, 1, '2020-03-01 23:19:11'),
(11, 'Sum Two Number', 'd', '', '', '', '17', '128<br />\n132<br />\n144', '', 2, 128000, NULL, 1, '2020-03-17 11:58:59'),
(23, 'hello BD', '<p>à¦†à¦®à¦°à¦¾ à¦à¦•à¦Ÿà¦¾ à¦ªà§à¦°à¦¬à¦²à§‡à¦® à¦¦à¦¿à§Ÿà§‡ à¦¶à§à¦°à§ à¦•à¦°à¦¿à¥¤ à¦§à¦° à¦¤à§à¦®à¦¾à¦•à§‡ N à¦¸à¦¾à¦‡à¦œ à¦à¦° à¦à¦•à¦Ÿà¦¾ à¦¸à§à¦Ÿà§à¦°à¦¿à¦‚ à¦¦à§‡à§Ÿà¦¾ à¦†à¦›à§‡à¥¤ Q à¦¸à¦‚à¦–à§à¦¯à¦• à¦•à§à§Ÿà§‡à¦°à¦¿ à¦¦à§‡à§Ÿà¦¾ à¦¹à¦²à¥¤ à¦ªà§à¦°à¦¤à¦¿à¦Ÿà¦¾ à¦•à§à§Ÿà§‡à¦°à¦¿à¦¤à§‡ L R X Y (0&lt;= L,R,X,Y &lt;N) à¦à¦‡ à¦šà¦¾à¦°à¦Ÿà¦¾ à¦¨à¦¾à¦®à§à¦¬à¦¾à¦° à¦¦à§‡à§Ÿà¦¾ à¦¥à¦¾à¦•à¦¬à§‡ à¦à¦¬à¦‚ à¦¬à¦²à¦¾ à¦¹à¦¬à§‡ à¦ à¦¸à§à¦Ÿà§à¦°à¦¿à¦‚ à¦à¦° L à¦¥à§‡à¦•à§‡ R à¦ªà¦°à§à¦¯à¦¨à§à¦¤ à¦¸à¦¾à¦¬à¦¸à§à¦Ÿà§à¦°à¦¿à¦‚ à¦à¦¬à¦‚ X à¦¥à§‡à¦•à§‡ Y à¦ªà¦°à§à¦¯à¦¨à§à¦¤ à¦¸à¦¾à¦¬à¦¸à§à¦Ÿà§à¦°à¦¿à¦‚ à¦¦à§à¦‡à¦Ÿà¦¾ à¦¸à¦¾à¦¬à¦¸à§à¦Ÿà§à¦°à¦¿à¦‚ à¦¸à¦®à¦¾à¦¨ à¦•à¦¿à¦¨à¦¾ à¦¬à§‡à¦° à¦•à¦°à¦¾à¦° à¦œà¦¨à§à¦¯à¥¤ à¦¯à¦¦à¦¿ à¦¸à¦®à¦¾à¦¨ à¦¹à§Ÿ à¦¤à¦¾à¦¹à¦²à§‡ YES à¦ªà§à¦°à¦¿à¦¨à§à¦Ÿ à¦•à¦°à¦¤à§‡ à¦¹à¦¬à§‡ à¦†à¦° à¦¯à¦¦à¦¿ à¦¸à¦®à¦¾à¦¨ à¦¨à¦¾ à¦¹à§Ÿ à¦¤à¦¾à¦¹à¦²à§‡ NO à¦ªà§à¦°à¦¿à¦¨à§à¦Ÿ à¦•à¦°à¦¤à§‡ à¦¹à¦¬à§‡à¥¤ à¦¯à¦¦à¦¿ à¦¨à¦¾ à¦¬à§à¦ à¦¤à¦¾à¦¹à¦²à§‡ à¦à¦•à¦Ÿà¦¾ à¦‰à¦¦à¦¾à¦¹à¦°à¦£ à¦¦à¦¿à§Ÿà§‡ à¦¬à¦¿à¦·à§Ÿà¦Ÿà¦¾ à¦ªà¦°à¦¿à¦·à§à¦•à¦¾à¦° à¦•à¦°à¦¾ à¦¯à¦¾à¦•-</p>\nà¦§à¦° à¦†à¦®à¦¾à¦¦à§‡à¦° à¦à¦•à¦Ÿà¦¾ à¦¸à§à¦Ÿà§à¦°à¦¿à¦‚ ST à¦¦à§‡à¦¯à¦¾ à¦†à¦›à§‡<span class=\"marker\"><span style=\"background-color:#ffff00\">,</span></span>&nbsp; &nbsp; &nbsp; &nbsp;<br />\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;ST = ABCDEF<br />\nà¦à¦•à¦Ÿà¦¾ à¦•à§à§Ÿà§‡à¦°à¦¿ à¦¦à§‡à§Ÿà¦¾ à¦†à¦›à§‡,<br />\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;L=1, R=4, X=2, Y=7<br />\nà¦†à¦®à¦¾à¦•à§‡ à¦¬à¦²à¦¤à§‡ à¦¹à¦¬à§‡,<br />\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;ST[L..R] à¦à¦¬à¦‚ ST[X...Y] à¦¸à¦®à¦¾à¦¨ à¦•à¦¿à¦¨à¦¾<br />\nà¦…à¦¥à¦¾à¦¨à§à¦¦,<br />\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;ST[1..4] = ABCD à¦à¦¬à¦‚ ST[2..7] = BCDE à¦¸à¦®à¦¾à¦¨ à¦•à¦¿à¦¨à¦¾<br />\n<br />\n<span class=\"equation\">\\(â€‹â€‹â€‹â€‹â€‹â€‹â€‹f(x) = s_1*p^1 + s_2*p^2 + s_3*p^3 \\)</span><span class=\"equation\">\\(\\)</span>', 'The first line of the input gives the number of test cases,&nbsp;<strong>T</strong>. Then&nbsp;<strong>T</strong>&nbsp;test cases follow. Each will consist of one line containing a single word&nbsp;<strong>s</strong>, which is the given string.', 'For each test case, output one line containing a single word&nbsp;<strong>p</strong>&nbsp;of minimum length such that there exists a positive integer&nbsp;<strong>k</strong>&nbsp;for which&nbsp;<strong>p * k</strong>&nbsp;equals&nbsp;<strong>s</strong>.', '2 5', '10<br />\nABAB<br />\nABABABAB<br />\nAAA<br />\nABC<br />\nA<br />\nASAASA<br />\nASDASASDAS<br />\nASDAS ASDA<br />\nAASAAASA', 'AB<br />\nAB<br />\nA<br />\nABC<br />\nA<br />\nASA<br />\nASDAS<br />\nASDAS<br />\nASDA<br />\nAASA', '', 2, 128000, NULL, 1, '2020-04-07 08:48:38'),
(26, 'test1', '<h1 style=\"text-align: center;\"><strong>Spam Filtering using Naive Bayes Classifiers</strong></h1>\n\n<h2 style=\"text-align: center;\"><strong>Sk. Amir Hamza</strong></h2>\n\n<h2 style=\"text-align: center;\"><strong>2017-1-60-091</strong></h2>\n', '', '', '', '', '', '', 2, 128000, NULL, 1, '2020-05-12 05:54:10'),
(27, 'hello', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2, 128000, '#include \"testlib.h\"\n#include <bits/stdc++.h>\nusing namespace std;\n\nbool checkPrime(int n){\n    if(n==1)return 0;\n    for(int i=2; i<n; i++)\n        if(n%i ==0)return 0;\n    return 1;\n}\n\nint main(int argc, char * argv[]) {\n    registerTestlibCmd(argc, argv);\n    int l=inf.readInt();\n    int r=inf.readInt();\n    int num = ouf.readInt();\n    \n    if(num>r || num<l)\n        quitf(_wa,\"%d is not range in %d and %d\",num,l,r);\n    \n    if(!checkPrime(num))\n        quitf(_wa,\"%d is not a prime number\",num);\n    \n    quitf(_ok,\"output is ok\");\n}\n', 1, '2020-06-21 06:57:38'),
