(29, 'New Problem', 'You are given a sequence of integers of length $n$ and integer number $k$. You should print \\textbf{any integer} number $x$ in the range of $[1; 10^9]$ (i.e. $1 \\le x \\le 10^9$) such that exactly $k$ elements of given sequence are less than or equal to $x$.<br />\n<br />\nNote that the sequence can contain equal elements.<br />\n<br />\nIf there is no such $x$, print ``\\t{-1}&#39;&#39; (without quotes).<span class=\"equation\">\\(x = {-b \\pm \\sqrt{b^2-4ac} \\over 2a}\\)</span>', '', '', '', '', '', '', 2, 128000, NULL, 1, '2020-06-21 13:46:16');
