(123, 1, 'binary', 1, '#include<bits/stdc++.h>\n#define MAX 100007\nusing namespace std;\ntypedef long long ll;\n\nvector<ll>t[4*MAX],v,sum[4*MAX];\nvoid build(ll node,ll l,ll r)\n{\n    if(l==r)\n    {\n        t[node].push_back(v[l-1]);\n        sum[node].push_back(0);\n        return;\n    }\n    ll mid=(l+r)/2;\n    build(node*2,l,mid);\n    build(node*2+1,mid+1,r);\n    merge(t[node*2].begin(),t[node*2].end(),\n          t[node*2+1].begin(),t[node*2+1].end(),back_inserter(t[node]));\n\n    for(ll i=0; i<t[node].size(); i++)\n    {\n        if(i==0)\n            sum[node].push_back(0);\n        else\n        {\n            ll diff=t[node][i]-t[node][i-1];\n            diff=(diff*(i));\n            sum[node].push_back(diff+sum[node][sum[node].size()-1]);\n        }\n    }\n}\n\nll query(ll node,ll l,ll r,ll i,ll j,ll k)\n{\n    if(l>j || r<i)\n        return 0;\n    if(l>=i && r<=j)\n    {\n        ll ans,pos,a,diff,pos1;\n        pos=lower_bound(t[node].begin(),t[node].end(),k)-t[node].begin();\n        pos1=pos;\n        if(pos==t[node].size())\n            pos--;\n        a=t[node][pos];\n        diff=a-k;\n        ans=sum[node][pos]-(diff*pos1);\n        return ans;\n    }\n    ll mid=(l+r)/2;\n    return query(node*2,l,mid,i,j,k)+query(node*2+1,mid+1,r,i,j,k);\n}\n\n\nint main()\n{\n    ios_base::sync_with_stdio(false);\n    cin.tie(NULL);\n    ll n,q,i,j,l,r,a,k,ans;\n    cin >> n >> q;\n    for(i=0; i<n; i++)\n    {\n        cin >> a;\n        v.push_back(a);\n    }\n    build(1,1,n);\n    for(i=0; i<q; i++)\n    {\n        cin >> l >> r >> k;\n        ans=query(1,1,n,l,r,k);\n        cout << ans << \"\\n\";\n    }\n\n    return 0;\n}', 53, NULL, 0.203, 22044, 0.203, 22044, 1, '2020-02-12 16:50:19', 11, 1, 1, 1, 0, 0, 5, 32812),
