(211, 2, 'binary', 1, '#include<bits/stdc++.h>\n#define MAX 1007\nusing namespace std;\n\nint visit[MAX],in[MAX],flag[MAX];\nvector<int>adj[MAX];\nvoid dfs(int s,int turn)\n{\n    if(visit[s]==1 && in[s]<turn)return;\n    visit[s]=1;\n    in[s]=turn;\n    for(int i=0; i<adj[s].size(); i++)\n        dfs(adj[s][i],turn+1);\n\n}\n\nint main()\n{\n\n    int q,n,m,u,v,s,i,j;\n    cin >> q;\n    for(i=0; i<q; i++)\n    {\n        cin >> n >> m;\n        for(j=0; j<m; j++)\n        {\n            cin >> u >> v;\n            adj[u].push_back(v);\n            adj[v].push_back(u);\n        }\n        cin >> s;\n        memset(visit,0,sizeof(visit));\n        memset(in,-1,sizeof(in));\n        dfs(s,0);\n        for(j=1; j<=n; j++)\n        {\n            int res=in[j];\n            res=(res==-1)?-1:res*6;\n            if(j!=s)cout << res << \" \";\n        }\n        cout << \"\\n\";\n        for(j=0; j<MAX-4; j++)adj[j].clear();\n    }\n\n    return 0;\n}', 54, 'C++ (GCC 9.2.0)', 0.012, 1984, 0.012, 1984, 1, '2020-02-17 05:57:33', 4, 1, 1, 2, 0, 0, 2, 13534),
