(243, 2, 'binary', 1, '#include<bits/stdc++.h>\nusing namespace std;\n#define ff first\n#define ss second\n#define mp make_pair\n\ntypedef long long LL;\ntypedef pair< LL, LL >PLL;\n\nconst PLL M = mp(1e9+7, 1e9+9);\nconst LL base = 347;\nconst int N = 2e5+7;\n\nostream &operator<<(ostream &out, PLL p) {\n    return out << \"(\" << p.ff << \", \" << p.ss << \")\";\n}\n\nPLL operator+(PLL a, LL x) { return mp(a.ff+x, a.ss+x); }\nPLL operator-(PLL a, LL x) { return mp(a.ff-x, a.ss-x); }\nPLL operator*(PLL a, LL x) { return mp(a.ff*x, a.ss*x); }\nPLL operator+(PLL a, PLL x) { return mp(a.ff+x.ff, a.ss+x.ss); }\nPLL operator-(PLL a, PLL x) { return mp(a.ff-x.ff, a.ss-x.ss); }\nPLL operator*(PLL a, PLL x) { return mp(a.ff*x.ff, a.ss*x.ss); }\nPLL operator%(PLL a, PLL m) { return mp(a.ff%m.ff, a.ss%m.ss); }\n\nPLL pb[N];\n\nvoid hashPre() {\n    pb[0] = mp(1, 1);\n    for (int i = 1; i < N; i++) {\n        pb[i] = (pb[i-1]*base)%M;\n    }\n}\n\nPLL concat(PLL left, PLL right, int k) {\n    return (left*pb[k]+right)%M;\n}\n\ntypedef struct item *pitem;\n\nstruct item {\n    int prior, cnt;\n    pitem l, r;\n    PLL shoja, ulta;\n    PLL value;\n    item(int val) : prior(rand()), value(mp(val, val)) {\n        cnt = 0;\n        l = r = nullptr;\n    }\n    void calc() {\n        shoja = value;\n        ulta = value;\n    }\n};\n\n\nnamespace Treap {\n    int cnt(pitem it) {\n        return it != nullptr ? it->cnt : 0;\n    }\n\n    PLL shoja(pitem it) {\n        return it != nullptr ? it->shoja : PLL(0, 0);\n    }\n    PLL ulta(pitem it) {\n        return it != nullptr ? it->ulta: PLL(0, 0);\n    }\n\n    void upd_cnt(pitem it) {\n        if (it != nullptr) {\n            it->cnt = cnt(it->l)+cnt(it->r)+1;\n            ///hash\n            it->shoja = concat(it->value, shoja(it->r), cnt(it->r));\n            it->shoja = concat(shoja(it->l), it->shoja, cnt(it->r)+1);\n\n            it->ulta = concat(it->value, ulta(it->l), cnt(it->l));\n            it->ulta = concat(ulta(it->r), it->ulta, cnt(it->l)+1);\n        }\n    }\n\n    void merge(pitem &t, pitem l, pitem r) {\n        if (l==nullptr||r==nullptr) t = (l != nullptr) ? l : r;\n        else if (l->prior > r->prior) merge(l->r, l->r, r), t = l;\n        else merge(r->l, l, r->l), t = r;\n        upd_cnt(t);\n    }\n\n    void split(pitem t, pitem &l, pitem &r, int key, int add = 0) {\n        if (t==nullptr) {\n            l = r = nullptr;\n            return;\n        }\n        int cur_key = add+cnt(t->l);\n        if (key <= cur_key) split(t->l, l, t->l, key, add), r = t;\n        else split(t->r, t->r, r, key, add+1+cnt(t->l)), l = t;\n        upd_cnt(t);\n    }\n\n    void insert(pitem &t, int key, int value) {\n        pitem x = new item(value);\n        x->calc();\n\n        pitem L, R;\n        split(t, L, R, key);\n        merge(L, L, x);\n        merge(t, L, R);\n\n        upd_cnt(t);\n    }\n\n    void erase(pitem &t, int key) {\n        assert(cnt(t) > key);\n        pitem L, MID, R;\n        split(t, L, MID, key);\n        split(MID, MID, R, 1);\n        merge(t, L, R);\n        delete MID;\n        upd_cnt(t);\n    }\n\n    void update(pitem &t, int key, int value) {\n        assert(cnt(t) > key);\n        pitem L, MID, R;\n        split(t, L, MID, key);\n        split(MID, MID, R, 1);\n\n        ///\n        MID->value = PLL(value, value);\n        MID->calc();\n\n        merge(L, L, MID);\n        merge(t, L, R);\n\n        upd_cnt(t);\n    }\n\n    bool isPal(pitem &t, int n) {\n        if (n == 1) return 1;\n        bool ans = false;\n        if (n % 2) {\n            pitem t1, t2, t3;\n            split(t, t1, t2, n/2);\n            split(t2, t2, t3, 1);\n            ans = ulta(t1) == shoja(t3);\n            merge(t, t1, t2);\n            merge(t, t, t3);\n        } else {\n            pitem t1, t2;\n            split(t, t1, t2, n/2);\n            ans = ulta(t1)==shoja(t2);\n            merge(t, t1, t2);\n        }\n        return ans;\n    }\n\n    int ask(pitem &t, int l, int r) {\n        pitem t1, t2, t3;\n        split(t, t1, t2, l);\n        split(t2, t2, t3, r-l+1);\n\n        bool ans = isPal(t2, r-l+1);\n\n        merge(t, t1, t2);\n        merge(t, t, t3);\n\n        return ans;\n    }\n}\n\n\nint main() {\n    ios::sync_with_stdio(false);\n    cin.tie(0);\n\n    hashPre();\n\n    string s;\n    cin >> s;\n    int n = s.size();\n\n    pitem tr = nullptr;\n    for (int i = 0; i < n; i++) {\n        Treap::insert(tr, i, s[i]);\n    }\n\n\n    int q;\n    cin >> q;\n\n    while (q--) {\n        char c;\n        cin >> c;\n\n        if (c==\'C\') {\n            int i, j;\n            cin >> i >> j;\n            if (i > j) swap(i, j);\n            i--; j--;\n            if (Treap::ask(tr, i, j)) cout << \"Yes!\\n\";\n            else cout << \"No!\\n\";\n        } else if (c == \'D\') {\n            int i;\n            cin >> i;\n            i--;\n            Treap::erase(tr, i);\n        } else {\n            int i; char c;\n            cin >> i >> c;\n            i--;\n            Treap::update(tr, i, c);\n        }\n    }\n\n\n\n    return 0;\n}', 54, 'C++ (GCC 9.2.0)', 0.021, 4560, 0.021, 4560, 1, '2020-02-29 16:33:25', 11, 1, 1, 1, 0, 0, 2, 26191),
