(477, 2, 'binary', 10, '#include<bits/stdc++.h>\n#define MAX 1000007\nusing namespace std;\ntypedef long long ll;\n \nstruct info\n{\n    ll single,doub,triple;\n    info(ll v1=0,ll v2=0,ll v3=0):single(v1),doub(v2),triple(v3) {}\n    info operator+(info a)\n    {\n        return info(single+a.single,doub+a.doub,triple+a.triple);\n    }\n};\n \ninfo tree[4*MAX];\nll in[MAX];\n \nvoid update(ll node,ll l,ll r,ll i,info val)\n{\n    if(l>i || r<i)return;\n    if(l==r && i==l)\n    {\n        tree[node]=tree[node]+val;\n        return;\n    }\n    ll mid=(l+r)/2;\n    update(node*2,l,mid,i,val);\n    update(node*2+1,mid+1,r,i,val);\n    tree[node]=tree[node*2]+tree[node*2+1];\n}\n \ninfo query(ll node,ll l,ll r,ll i,ll j)\n{\n    if(l>j || r<i)return {0,0,0};\n    if(l>=i && r<=j)return tree[node];\n    ll mid=(l+r)/2;\n    return query(node*2,l,mid,i,j)+query(node*2+1,mid+1,r,i,j);\n}\n \n \n \nint main()\n{\n    ios_base::sync_with_stdio(false);\n    cin.tie(NULL);\n    ll n,i,k,q,l,r,c=0,a,ans=0;\n    map<ll,ll>mp,cnt;\n    vector<ll>v,v1;\n    cin >> n;\n    for(i=0; i<n; i++)\n    {\n        cin >> a;\n        v.push_back(a);\n \n    }\n    v1=v;\n    sort(v1.begin(),v1.end());\n    for(i=0; i<v1.size(); i++)\n    {\n        if(mp[v1[i]]==0)mp[v1[i]]=++c;\n    }\n    reverse(v.begin(),v.end());\n    for(i=0; i<v.size(); i++)\n    {\n        a=v[i];\n        cnt[a]++;\n        info val=query(1,1,c,1,mp[a]-1);\n        info upVal;\n        upVal.triple=val.doub;\n        upVal.doub=val.single;\n        upVal.single=cnt[a];\n        update(1,1,c,mp[a],upVal);\n    }\n    for(i=1; i<=c; i++)\n    {\n        info ret=query(1,1,c,i,i);\n        ans+=ret.triple;\n    }\n \n    cout << ans << \"\\n\";\n \n \n \n \n    return 0;\n}', 53, 'C++ (GCC 8.3.0)', 0.048, 12800, 0.048, 12800, 1, '2020-05-01 17:59:29', 11, 1, 1, 1, 0, 0, 1, 86249),
