(512, 2, 'binary', 1, '#include<bits/stdc++.h>\n#define MAX 500007\nusing namespace std;\ntypedef long long ll;\n\nvector<ll>t[4*MAX];\nll in[MAX];\n\nvoid build(ll n,ll l,ll r)\n{\n    if(l==r)\n    {\n        t[n].push_back(in[l]);\n        return;\n    }\n    ll mid=(l+r)/2;\n    build(n*2,l,mid);\n    build(n*2+1,mid+1,r);\n    merge(t[n*2].begin(),t[n*2].end(),t[n*2+1].begin(),t[n*2+1].end(),back_inserter(t[n]));\n}\n\nll query(ll node,ll l,ll r,ll i,ll j,ll k)\n{\n    if(l>j || r<i)return 0;\n    if(l>=i && r<=j)\n    {\n        ll low=lower_bound(t[node].begin(),t[node].end(),k)-t[node].begin();\n        ll up=upper_bound(t[node].begin(),t[node].end(),k)-t[node].begin();\n        return up-low;\n    }\n    ll mid=(l+r)/2;\n    return query(node*2,l,mid,i,j,k)+query(node*2+1,mid+1,r,i,j,k);\n}\n\nint main()\n{\n\n    ll n,i,a,sum=0,ans=0,b;\n    cin >> n;\n    for(i=0; i<n; i++){\n        cin >> a >> b;\n        cout << a+b << \"\\n\";\n    }\n\n\n    return 0;\n}\n', 54, 'C++ (GCC 9.2.0)', 0.031, 12800, 0.031, 12800, 1, '2020-05-04 11:50:46', 11, 1, 1, 1, 0, 0, 8, 62923),
