(515, 2, 'binary', 3, '#include<bits/stdc++.h>\n#define P 41\n#define MOD 1000000007\n#define MAX 5007\nusing namespace std;\ntypedef long long ll;\n \nstruct str\n{\n    ll hashVal,c;\n};\n \nll dp[MAX];\n \nll bigMod(ll n,ll k)\n{\n    if(k==0)return 1;\n    if(k==1)return n;\n    if(dp[k]!=-1)return dp[k];\n    ll x=bigMod(n,k/2);\n    x=(x*x)%MOD;\n    if(k&1)x=(x*n)%MOD;\n    return dp[k]=x;\n}\n \nstr cmp(str a,str b)\n{\n    str res;\n    res.hashVal=(a.hashVal+(bigMod(P,a.c)*b.hashVal)%MOD)%MOD;\n    res.c=a.c+b.c;\n    return res;\n}\n \nstring st[5];\nstr tree[5][4*MAX];\nvoid build(ll node,ll l,ll r,ll no)\n{\n    if(l==r)\n    {\n        tree[no][node]= {st[no][l],1};\n        return;\n    }\n    ll mid=(l+r)/2;\n    build(node*2,l,mid,no);\n    build(node*2+1,mid+1,r,no);\n    tree[no][node]=cmp(tree[no][node*2],tree[no][node*2+1]);\n}\n \nstr query(ll node,ll l,ll r,ll i,ll j,ll no)\n{\n    if(l>j || r<i)return {0,0};\n    //cout << l << \" \"<< r << \" \" << i << \" \" << j << \"\\n\";\n    if(l>=i && r<=j)return tree[no][node];\n    ll mid=(l+r)/2;\n    return cmp(query(node*2,l,mid,i,j,no),query(node*2+1,mid+1,r,i,j,no));\n}\n \nbool check(ll mid)\n{\n    ll i,hashVal,l,r,j,a,b,c;\n    vector<ll>v[3];\n    map<ll,ll>mp[4];\n    for(i=0; i<3; i++)\n    {\n        for(j=0; j<st[i].size(); j++)\n        {\n            l=j,r=j+mid-1;\n            if(r>=st[i].size())break;\n            //cout << l << \" \" << r << \" \" << i << \" \" << mid << \" gey\\n\";\n            str s=query(1,0,st[i].size()-1,l,r,i);\n            if(i==0)v[i].push_back(s.hashVal);\n            if(i>0)mp[i][s.hashVal]=1;\n        }\n        // cout << i << \" ++\\n\";\n    }\n \n    // cout << mid << \"\\n\";\n    for(i=0; i<v[0].size(); i++)\n    {\n        a=v[0][i];\n        if(mp[1].count(a) && mp[2].count(a))return 1;\n    }\n    return 0;\n}\n \nll bsearch(ll l,ll r)\n{\n    if((r-l)==1)\n    {\n        if(check(r)==1)return r;\n        return l;\n    }\n    ll mid=(l+r)/2;\n    if(check(mid)==1)return bsearch(mid,r);\n    else return bsearch(l,mid);\n}\n \nll solve()\n{\n    ll i,j,ans;\n    cin >> st[0] >> st[1] >> st[2];\n    for(i=0; i<3; i++)build(1,0,st[i].size()-1,i);\n    ans=bsearch(0,min(st[0].size(),min(st[1].size(),st[2].size())));\n    return ans;\n}\n \n \nint main()\n{\n   // freopen(\"input.txt\",\"r\",stdin);\n    memset(dp,-1,sizeof(dp));\n    ll t,i,ans;\n    cin >> t;\n    for(i=1; i<=t; i++)\n    {\n        ans=solve();\n        cout << \"Case \" << i << \": \" << ans << \"\\n\";\n    }\n \n    return 0;\n}\n ', 53, 'C++ (GCC 8.3.0)', 0.05, 96448, 0.05, 96448, 1, '2020-05-04 13:28:54', 11, 1, 1, 1, 0, 0, 2, 89813),
