  treer[i] = merge(treer[2 * i], treer[2 * i + 1]);\n }\n \n  for (int i = 0; i < m; i++)\n {\n   for (int x = 0; x < 2; x++)\n   {\n     for (int y = 0; y < 2; y++)\n     {\n       treem[treesize + i].dp[x][y] = calcdp(au[i] ^ x, ad[i] ^ y, n);\n     }\n   }\n   treeu[treesize + i].cnt[0] = 1 - au[i];\n   treeu[treesize + i].cnt[1] = au[i];\n   treed[treesize + i].cnt[0] = 1 - ad[i];\n   treed[treesize + i].cnt[1] = ad[i];\n }\n for (int i = m; i < treesize; i++)\n  {\n   for (int x = 0; x < 2; x++)\n   {\n     for (int y = 0; y < 2; y++)\n     {\n       for (int t = 0; t < 2; t++)\n       {\n         for (int u = 0; u < 2; u++)\n         {\n           treem[treesize + i].dp[x][y].dp[t][u] = (t == u ? 0 : n);\n         }\n       }\n     }\n   }\n }\n for (int i = treesize - 1; i > 0; i--)\n  {\n   treem[i] = merge(treem[2 * i], treem[2 * i + 1]);\n   treeu[i] = merge(treeu[2 * i], treeu[2 * i + 1]);\n   treed[i] = merge(treed[2 * i], treed[2 * i + 1]);\n }\n \n  printf(\"%d\\n\", getans());\n  for (int q = 0; q < nq; q++)\n  {\n   int l, r;\n   scanf(\"%s%d%d\", op, &l, &r);\n    l--, r--;\n   if (op[0] == \'L\')\n   {\n     doinv(treen, 1, 0, treesize - 1, l, r, true);\n     inv(treel, 1, 0, treesize - 1, l, r);\n   } else if (op[0] == \'R\')\n    {\n     doinv(treen, 1, 0, treesize - 1, l, r, false);\n      inv(treer, 1, 0, treesize - 1, l, r);\n   } else if (op[0] == \'U\')\n    {\n     doinv(treem, 1, 0, treesize - 1, l, r, true);\n     inv(treeu, 1, 0, treesize - 1, l, r);\n   } else if (op[0] == \'D\')\n    {\n     doinv(treem, 1, 0, treesize - 1, l, r, false);\n      inv(treed, 1, 0, treesize - 1, l, r);\n   }\n   printf(\"%d\\n\", getans());\n  }\n \n    return 0;\n}\n', 3, 'C++11', 0.124, 0, 0.124, 0, 1, '2020-06-19 01:18:18', 4, 1, 1, 1, 0, 0, 8, 90),
